import React,{useEffect, useState} from 'react';
import axios from 'axios'
import './Home.css'

function Home() {

  const[product, setProduct] = useState(null)

  useEffect( ()=>{
    const fetchProduct = () =>{
      const url ='https://fakestoreapi.com/products';
      axios.get(url)
      .then((res)=>{setProduct(res.data)});
    };
    fetchProduct()
    console.log(product);
  },[])

  return (
    <div className='product'>
      {
        product &&
        product.map(item=>
          <div key={item.id} >
            <img src={item.image} alt={item.title} width='100px' height='120px'/>
            <h2>{item.title}</h2>
            <p>{item.description}</p>
            <button>Add To Cart</button>
          </div>
        )
      }
    </div>
  )
}

export default Home
